import { generateUtilityClass, generateUtilityClasses } from '../className';
export function getFormControlUtilityClass(slot) {
  return generateUtilityClass('JoyFormControl', slot);
}
const formControlClasses = generateUtilityClasses('JoyFormControl', ['root', 'error', 'disabled', 'colorPrimary', 'colorNeutral', 'colorDanger', 'colorInfo', 'colorSuccess', 'colorWarning', 'sizeSm', 'sizeMd', 'sizeLg']);
export default formControlClasses;
